import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Button, StyleSheet, Text, View, Alert } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <View style={styles.buttonStyleContainer}>
        <View style={styles.buttonStyle}>
      <Button title="1"
      onPress={() => Alert.alert('1')}
      //style={styles.buttonStyle}
      color= '#E2DEDE'
      /></View>
      <View style={styles.buttonStyle}>
      <Button title="2"
      onPress={() => Alert.alert('2')}
      //style={styles.buttonStyle}
      color= '#E2DEDE'
      /></View>
      <View style={styles.buttonStyle}>
      <Button title="3"
      onPress={() => Alert.alert('3')}
      //style={styles.buttonStyle}
      color= '#E2DEDE'
      /></View>
      </View>
      <View style={styles.buttonStyleContainer}>
        <View style={styles.buttonStyle}>
          <Button title="4"
          onPress={() => Alert.alert('1')}
          //style={styles.buttonStyle}
          color= '#E2DEDE'
          /></View>
        <View style={styles.buttonStyle}>
          <Button title="5"
          onPress={() => Alert.alert('2')}
          //style={styles.buttonStyle}
          color= '#E2DEDE'
          /></View>
        <View style={styles.buttonStyle}>
          <Button title="6"
          onPress={() => Alert.alert('3')}
          //style={styles.buttonStyle}
          color= '#E2DEDE'
          /></View>
      </View>
      <View style={styles.buttonStyleContainer}>
      <View style={styles.buttonStyle}>
      <Button title="7"
      onPress={() => Alert.alert('1')}
      //style={styles.buttonStyle}
      color= '#E2DEDE'
      /></View>
      <View style={styles.buttonStyle}>
      <Button title="8"
      onPress={() => Alert.alert('2')}
      //style={styles.buttonStyle}
      color= '#E2DEDE'
      /></View>
      <View style={styles.buttonStyle}>
      <Button title="9"
      onPress={() => Alert.alert('3')}
      //style={styles.buttonStyle}
      color= '#E2DEDE'
      /></View>
      </View>
      <View style={styles.buttonStyleContainer}>
      <View style={styles.buttonStyle}>
      <Button title="*"
      onPress={() => Alert.alert('*')}
      //style={styles.buttonStyle}
      color= '#E2DEDE'
      /></View>
      <View style={styles.buttonStyle}>
      <Button title="0"
      onPress={() => Alert.alert('0')}
      //style={styles.buttonStyle}
      color= '#E2DEDE'
      />
      </View>
      <View style={styles.buttonStyle}>
      <Button title="#"
      onPress={() => Alert.alert('#')}
      //style={styles.buttonStyle}
      color= '#E2DEDE'
      /></View>
      </View>


      <StatusBar style="auto" />
    </View>
    );
}



const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#ffffff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  buttonStyleContainer: {
    flexDirection: 'row',
    alignContent: 'flex-end',
  },
  buttonStyle: {
    flex:1,
    borderWidth: 0.5,
    borderColor: '#8F8C8C',
  }
});
